import React from 'react'
import { Row, Col, Container, Card, CardBody } from 'reactstrap';

const DetailFunc = ({func, btnClick}) => {
  return (
    <div>
        {func.map((item)=>(
            <Col md="4">
            <Card className="card-shadow">
                <a href="#" className="img-ho" onClick={btnClick}><img className="card-img-top" alt="wrappixel kit" src={item.url} /></a>
                <CardBody>
                    <h5 className="font-medium m-b-0">{item.effect}</h5>
                </CardBody>
            </Card>
        </Col>
        ))}        
    </div>
  )
}

export default DetailFunc
